import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import UploadResume from './components/UploadResume';
import ReviewResumes from './components/ReviewResumes';
import ViewReviews from './components/ViewReviews'; // Import the new component
import ProtectedRoute from './components/ProtectedRoute';
import Home from './components/Home';
const App = () => {
    return (
        <Router>
            <Routes>
            <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/upload" element={<UploadResume />} />
                <ProtectedRoute path="/reviews" element={<ReviewResumes />} />
                <ProtectedRoute path="/my-reviews" element={<ViewReviews />} /> {/* Add the new route */}
                {/* Add more routes as needed */}
            </Routes>
        </Router>
    );
};

export default App;
